static void SumoHSM_change_strategy(SumoHSM * const me) {
    me->strategy++;
    if (me->strategy > 2){
        me->strategy = 0;
    }
}

static void SumoHSM_change_pre_strategy(SumoHSM * const me) {
    me->pre_strategy++;
    if (me->pre_strategy > 3){
        me->pre_strategy = 0;
    }
}

